import React from 'react'
import {Carousel} from "react-bootstrap"
import { useNavigate } from 'react-router-dom'

function Vaccine() {
  const navi=useNavigate()
  return (
    <div><Carousel>
    <Carousel.Item>
      <img
        className="d-block w-100"
        src="data:image/jpeg;base64,"
        alt="First slide"
      />
      <Carousel.Caption>
        <h3>COVISHEILD</h3>
      </Carousel.Caption>
    </Carousel.Item>
    <Carousel.Item>
      <img
        className="d-block w-100"
        src="data:image/jpeg;base64,"
        alt="Second slide"
      />
  
      <Carousel.Caption>
        <h3>COVAXIN</h3>
        
      </Carousel.Caption>
    </Carousel.Item>
    <Carousel.Item>
      <img
        className="d-block w-100"
        src="data:image/jpeg;base64,"
        alt="Third slide"
      />
  
      <Carousel.Caption>
        <h3>SPUTNIK</h3>
      </Carousel.Caption>
    </Carousel.Item>
  </Carousel>
  <button onClick={()=>navi('/signup')} className='button'>Need to sign in First</button>
  </div>
  )
}

export default Vaccine